import ContactSection from "../ContactSection";
import Developed from "../Developed";
import "./style.css";

const Footer = () => {
  return (
    <footer>
      <h2>CONTACTO</h2>
      <ContactSection />
      <Developed />
    </footer>
  );
};
export default Footer;
